;; **
;;; # Black box analysis using symbolic regression
;;;
;;; I have a huge CSV file filled with training inputs and outputs. I can't
;;; even load it in Clojure because it uses up too much memory. Solution:
;;;
;;; 1. Break up file into smaller size, only training on small number of lines
;;; 2. Use PushGP to evolve solutions using this file as the fitness
;;; 3. Test solution on another part of the dataset to check for overfitting
;;;
;;; Currently this is pretty hard coded/bad code, because I use the absolute
;;; path to the `shuf` linux utility on my machine to divide up the CSV.
;;; So it (probably) won't work if you try to run it. (Sorry)
;; **

;; @@
(use 'kaggle-loan.core)

